import { useParams } from "react-router";
import { mockItineraries } from "./ItinerariesPage";

interface SingleItineraryPageProps {
    itinerary: any;
}

export const SingleItineraryPage = () => {
    const params = useParams();

    result = mockItineraries.filter(itinerary => itinerary.id === parseInt(params.itineraryId!));

    return (
        <>
            {params.itineraryId}
        </>
    )
};
